{
  "document_type": "Admin FAQ",
  "course_id": "PDEV6800Z",
  "version": "1.2.0",
  "last_updated": "2024-07-03",
  "faq_categories": [
    {
      "category": "Course Information and Resources",
      "questions": [
{
          "question": "Is PDEV6800Z mandatory for all full-time RPg students?",
          "answer": "Yes, all full-time RPg students admitted in 2019/20 and thereafter are required to complete PDEV6800Z to strengthen their competence in teaching and prepare them for TA duties."
        },    
{
          "question": "What's the difference in teaching requirements between MPhil and PhD students after completing PDEV6800Z?",
          "answer": "After completing PDEV6800Z, MPhil students are required to give at least one 30-minute session of instructional delivery in front of a group of students for one term. PhD students are required to give at least one such session each in two different terms. The exact number varies among schools and departments."
        },    
{
          "question": "Where can I find the slides and the recording of the GTA Briefing Session?",
          "answer": "You can find the slides and recording on the CEI website here: https://cei.hkust.edu.hk/en-hk/programs-and-events/graduate-teaching-assistant-program/gta-briefing-session"
        },
        {
          "question": "When can I find the schedule of PDEV6800?",
          "answer": "The schedule is available on the course syllabus on Canvas or via this link: https://cei.hkust.edu.hk/en-hk/programs-and-events/graduate-teaching-assistant-program/pdev6800z, under the Course Schedule section."
        },
        {
          "question": "What will be the mode of delivery for PDEV6800Z?",
          "answer": "PDEV6800 is delivered in a gamified flipped classroom format, comprising three main components: online pre-class materials, face-to-face sessions, and online post-class challenges."
        },
        {
          "question": "How do I access the pre-class materials for PDEV6800Z?",
          "answer": "The pre-class materials for PDEV6800Z will be posted on Canvas 2 weeks before the first class, and 1 week before the subsequent classes."
        },
        {
          "question": "How do I access and prepare for the pre-class materials?",
          "answer": "All pre-class materials are uploaded on Canvas, 2 weeks before the first module, and 1 week before the subsequent modules. Students need to read all the pre-class materials to unlock the Module Challenge of that module. Canvas, the institution-wide LMS, is used in this course."
        },
        {
          "question": "Are there any specific tools or software I need to access the course materials?",
          "answer": "Canvas, the institution-wide Learning Management System (LMS), is used for this course. No additional software is required."
        }
      ]
    },
{
      "category": "Registration and Enrollment",
      "questions": [
        {
          "question": "Where can I register for PDEV6800Z?",
          "answer": "All students are auto-enrolled in PDEV6800Z, so you do not need to register."
        },
        {
          "question": "What is the maximum number of students per session?",
          "answer": "Each session can accommodate up to 65 students."
        },
        {
          "question": "When can I start to swap my session?",
          "answer": "You may swap sessions during the university's add/drop period. Please visit the ARO website (https://registry.hkust.edu.hk/) for class enrollment dates. If the session you wish to swap into is full, you will be placed on a waitlist. If the swap is unsuccessful, you will remain in your original session. Please check your enrolled session and confirmed class schedule after the add/drop period."
        },
        {
          "question": "What should I do if I have a scheduling conflict with another course?",
          "answer": "Follow the swap class procedure during the university's add/drop period. If the session you wish to swap into is full, you will be placed on a waitlist. If the swap is unsuccessful, you will remain in your original session."
        },
        {
          "question": "If my ITSC account is not yet activated, can I still enroll in PDEV6800Z?",
          "answer": "An ITSC network account is required to access your SIS. You can activate your account via this link: http://www.ust.hk/itsc/account/stuacc/enquiry"
        }
      ]
    },
    {
      "category": "Attendance and Participation",
      "questions": [
        {
          "question": "What is the attendance policy for PDEV6800Z?",
          "answer": "Full attendance is required for this course. If you are sick, you need to email your instructor and cc taprog@ust.hk, providing a medical certificate. Admin staff will contact you to discuss make-up arrangements. If you cannot attend the make-up class, your status for this course on SIS (Student Information System) will be PP, and you'll need to attend the corresponding session in the following semester."
        },
        {
          "question": "What if I need to attend a conference or other academic event?",
          "answer": "You need to email your instructor and cc taprog@ust.hk or notify us via this link: https://ust.az1.qualtrics.com/jfe/form/SV_b8WQshIA7Jf2JdI, selecting General Enquiry. Provide evidence of participation in the event."
        }
        {
          "question": "If I cannot attend one of the modules due to personal reasons, do I need to retake the whole PDEV6800 again?",
          "answer": "If you cannot attend one of the modules, notify us via this link: https://ust.az1.qualtrics.com/jfe/form/SV_b8WQshIA7Jf2JdI and select General Enquiry. You need a valid reason to attend the same module from another session this semester. If you miss more than one module, you will need to retake PDEV6800Z next semester."
        },
